  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:35.255779\",\n\t\"name\": \"quivira-national-wildlife-refuge-annual-narrative-reports-calendar-year-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Quivira
  NWR outlines Refuge accomplishments during the 1988 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, safety, and technical assistance is given. Habitat
  management is also covered; subjects include wetlands, croplands, grasslands, grazing,
  fire management, pest control, water rights, and wilderness areas. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, fisheries
  resources, scientific collections, and animal control. The public uses of the Refuge
  described in this report include outdoor classrooms, interpretive programs, hunting,
  fishing, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  rehabilitation, major maintenance, equipment replacement, communication systems,
  and computer systems. Cooperative programs, economic uses of the Refuge, and items
  of interest are provided at the end. Refuge brochures and field guides are attached.\",\n\t\"license_title\":
